import React from "react";
import "./FuncCard.css"

let FuncCard =(props) => {
    let{id,name,age,designation} = props.employee
    return(
        <div>
           <div className="card">
               <div className="card-body">
                   <h3>React-JS</h3>
                   <ul>
                       <li>ID : {id}</li>
                       <li>NAME : {name}</li>
                       <li>AGE : {age}</li>
                       <li>DSSIGNATION : {designation}</li>
                   </ul>

               </div>
           </div>
        </div>
    );


};

export default FuncCard;
